INSERT INTO `email_templates` (`id`, `name`, `subject`, `content`, `email_type`, `is_deleted`, `created_by`, `updated_by`, `created_at`, `updated_at`, `deleted_at`, `slug`) VALUES
(1, 'jobalert', 'You have new job alerts', '<p>Hi {full_name},</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Good news ! You have received this message because an organization has posted a job that is close to your preferences.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>{home_link}&nbsp; to enter your profile and see the job notice in the Alerts section.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Best,</p>\r\n\r\n<p>Admin, JobTrends</p>', 0, 1, 9, 9, '2023-10-27 06:49:05', '2023-10-30 03:33:52', '2023-10-30 03:33:52', NULL),
(2, 'Test', 'Test', '<p>Hi {first_name},</p>', 0, 0, 9, 9, '2023-10-27 07:54:23', '2023-10-27 07:54:23', NULL, NULL),
(3, 'application status update', 'Application Status Updated', '<p>Hi {name},</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>{company_name}</strong> has updated your application status to &quot;<strong>{status}</strong>&quot; for a job &quot;<strong>{title}</strong>&quot;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Best,</p>\r\n\r\n<p>Admin, Saas Talent</p>', 0, 1, 9, 9, '2023-10-30 03:36:08', '2023-10-30 04:58:11', '2023-10-30 04:58:11', NULL),
(4, 'application status update', 'Application Status Updated', '<p>Hi {first_name},</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>{company_name}</strong> has updated your application status to &quot;<strong>{status}</strong>&quot; for a job &quot;<strong>{title}</strong>&quot;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Best,</p>\r\n\r\n<p>Admin, FreeJobAds</p>', 0, 0, 9, 9, '2023-10-30 05:01:10', '2024-04-03 07:35:48', NULL, 'application-status-updated'),
(5, 'Test', 'Test', '<p>Hello Hello Hello&nbsp;{first_name},</p>', 0, 0, 9, 9, '2023-10-30 05:03:28', '2023-10-30 05:03:28', NULL, NULL),
(6, 'Interview Schedule', 'Interview Schedule', '<p><strong>Hi {first_name},</strong></p>\r\n\r\n<p><strong>{</strong>company_name}&nbsp;<strong>has scheduled an interview for&nbsp;</strong>: {title}</p>\r\n\r\n<p><strong>Interview DateTime</strong>: {datetime}</p>\r\n\r\n<p><strong>Interview Link</strong>: {interview_link}</p>\r\n\r\n<p><strong>Description</strong>: {description}</p>\r\n\r\n<p>Thanks,</p>\r\n\r\n<p>FreeJobAds</p>', 0, 0, 9, 9, '2023-10-30 06:33:29', '2024-04-03 07:36:43', NULL, NULL),
(7, 'Job Application', 'Job Application', '<p><strong>Hello </strong>{full_name}<strong>,</strong></p>\r\n\r\n<p>{full_name}&nbsp;has applied to your job&nbsp;{title}</p>', 0, 0, 9, 9, '2023-10-31 02:04:27', '2023-10-31 02:04:27', NULL, NULL),
(8, 'Password Change', 'Password Change', '<p>Your Password has been changed successfully. please click on below link and do sign in with your new password.</p>\r\n\r\n<p>{login_link}</p>', 0, 0, 9, 9, '2023-10-31 07:05:07', '2023-10-31 07:34:42', NULL, NULL),
(9, 'Account Remove', 'Account Remove', '<p><strong>Hi&nbsp;&nbsp;{full_name}{company_name},</strong></p>\r\n\r\n<p>Your&nbsp;<strong>{full_name} {company_name}&nbsp;</strong>account was removed Successfully.</p>', 0, 0, 9, 9, '2023-11-01 00:43:38', '2023-11-01 00:49:26', NULL, NULL),
(10, 'Verify Email For company name', 'Verify Email For Jobiclue-Trends', '<p><strong>Hi&nbsp;&nbsp;{full_name}{company_name},</strong></p>\r\n\r\n<p>Welcome to the JobTrends India. You have successfully created an account. You will be able to;</p>\r\n\r\n<p>* View Job Postings</p>\r\n\r\n<p>* Apply for listed Jobs</p>\r\n\r\n<p>* Apply for listed Jobs</p>\r\n\r\n<p>* Manage communication with potential employers</p>', 0, 0, 9, 9, '2023-11-01 01:11:01', '2023-11-01 01:11:55', NULL, NULL),
(11, 'Order Confirm', 'Order Confirm', '<p>Test Content</p>', 0, 0, 9, 9, '2023-11-01 06:03:53', '2023-11-01 06:03:53', NULL, NULL),
(12, 'Contact to Admin', 'Aamir Bhai', '<p>Hello&nbsp;</p>', 0, 0, 9, 9, '2023-11-09 04:53:14', '2023-11-09 04:53:14', NULL, NULL),
(13, 'Job seeker confirmation for complete probation period', 'Job seeker confirmation for complete probation period', '<p>Hi <strong>{employer_name}</strong>,</p>\r\n\r\n<p><strong>&nbsp;{job_seeker_name}</strong> is going to Complete Probation at <strong>{date}</strong>.</p>', 0, 0, 1, 1, '2024-04-23 09:23:35', '2024-04-23 09:23:35', NULL, 'job-seeker-confirmation-for-complete-probation-period'),
(14, 'Job seeker dispute mail send', 'Job seeker dispute mail send', '<p>Hi <strong>{admin_name}</strong>,<br />\r\n<br />\r\n<strong>{employer_name}</strong> has <strong>{action}</strong> <strong>{job_seeker_name}</strong><br />\r\n<br />\r\n<strong>{dispute_reason}</strong></p>', 0, 0, 1, 1, '2024-04-23 09:24:46', '2024-04-23 09:24:46', NULL, 'job-seeker-dispute-mail-send'),
(15, 'Completed Probation Period by Job Seeker', '{jobseeker_name} finished Probation Period', '<p>Hi <strong>{name}</strong>,</p>\r\n\r\n<p>This <strong>{jobseeker_name}</strong> has completed Probation Period.</p>\r\n\r\n<p>Our Finance Person &nbsp;will proceed Payment Process shortly for <strong>{jobseeker_name}</strong>.</p>\r\n\r\n<p><strong>{introducerDetails}</strong></p>\r\n\r\n<p><br />\r\nThanks<br />\r\nVR Excellance&nbsp;</p>', 0, 0, 1, 1, '2024-04-23 09:26:12', '2024-04-23 09:26:12', NULL, 'completed-probation-period-by-job-seeker'),
(16, 'Job Seeker Referral Status Update', 'Job Seeker Referral Status Update', '<p>Hi <strong>{name}</strong>,</p>\r\n\r\n<p>Your referral user <strong>{jobseeker_name} </strong>status is changed to <strong>{status}.</strong><br />\r\n<br />\r\n<br />\r\nThanks<br />\r\nVR Excellance&nbsp;</p>', 0, 0, 1, 1, '2024-04-29 06:14:40', '2024-04-29 06:14:40', NULL, 'job-seeker-referral-status-update'),
(17, 'Job Seeker Application Rejected', 'Job Seeker Application Rejected', '<p>Hi <strong>{first_name}</strong>,</p>\r\n\r\n<p><br />\r\n<strong>{company_name}</strong>&nbsp;has updated your application status to &quot;<strong>{status}</strong>&quot; for a job &quot;<strong>{title}</strong>&quot;<br />\r\n&nbsp;</p>\r\n\r\n<p>Best,</p>\r\n\r\n<p>Admin, FreeJobAds</p>', 1, 0, 1, 1, '2024-05-01 07:52:46', '2024-05-01 07:52:46', NULL, 'job-seeker-application-rejected'),
(18, 'Job Seeker Conclusion Reminder Mail', 'Job Seeker Conclusion Reminder Mail', '<p>Hi&nbsp;<strong>{name}</strong>,</p>\r\n\r\n<p>You didn&#39;t update for<strong>&nbsp;{job_seeker_name}</strong>&nbsp;job application&nbsp;for&nbsp;<strong>{job_title}</strong>.</p>\r\n\r\n<p>Best,</p>\r\n\r\n<p>Admin, FreeJobAds</p>', 0, 0, 1, 1, '2024-05-01 07:54:00', '2024-05-01 07:54:00', NULL, 'job-seeker-conclusion-reminder-mail'),
(19, 'Job Seeker Interview Feedback Mail', 'Job Seeker Interview Feedback Mail', '<p>Hi&nbsp;<strong>{name}</strong>,<br />\r\n<br />\r\nThis is feedback email for interviewer&nbsp;<strong>{job_seeker_name} </strong>for job application&nbsp;<strong>{job_title}</strong>.<br />\r\n<br />\r\nclick here for feedback {link}.<br />\r\n<br />\r\nBest,</p>\r\n\r\n<p>Admin, FreeJobAds</p>', 0, 0, 1, 1, '2024-05-01 07:54:51', '2024-05-01 07:54:51', NULL, 'job-seeker-interview-feedback-mail'),
(20, 'Employer Interview Feedback Reminder Mail', 'Employer Interview Feedback Reminder Mail', '<p>Hi&nbsp;<strong>{name}</strong>,</p>\r\n\r\n<p>Please update the status for job&nbsp;<strong>{job_title}</strong>&nbsp;and let us know if you&#39;ll be hiring<br />\r\nthe candidate&nbsp;<strong>{job_seeker_name}</strong>&nbsp;or update the system.<br />\r\n<br />\r\nclick here to update :&nbsp;<strong>{link}</strong><br />\r\n<br />\r\nThanks<br />\r\nVR Excellance</p>', 0, 0, 1, 1, '2024-06-04 05:41:54', '2024-06-04 05:41:54', NULL, 'employer-interview-feedback-reminder-mail'),
(21, 'Employer Not Responding Interview Feedback', 'Employer Not Responding Interview Feedback', '<p>Hi&nbsp;<strong>{name}</strong>,<br />\r\n<br />\r\nEmployer&nbsp;<strong>{employer_name}</strong>&nbsp;is not responding to&nbsp;<strong>{job_title}</strong>&nbsp;job application&nbsp;of&nbsp;<strong>{jobseeker_name}</strong>.<br />\r\n&nbsp;</p>\r\n\r\n<p>Thanks<br />\r\nVR Excellance</p>', 0, 0, 1, 1, '2024-06-04 05:44:08', '2024-06-04 05:44:08', NULL, 'employer-not-responding-interview-feedback'),
(22, 'Interview Reminder To Jobseeker', 'Interview Reminder To Jobseeker', '<p>Hi&nbsp;<strong>{name}</strong>,</p>\r\n\r\n<p>This is the reminder mail&nbsp;for your interview which is scheduled at {datetime} check more details below.<br />\r\n<br />\r\n{company_name}&nbsp;<strong>has scheduled an interview for&nbsp;</strong>: {title}</p>\r\n\r\n<p><strong>Interview DateTime</strong>: {datetime}</p>\r\n\r\n<p><strong>Interview Link</strong>: {interview_link}</p>\r\n\r\n<p><strong>Description</strong>: {description}</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thanks,</p>\r\n\r\n<p>FreeJobAds</p>', 0, 0, 1, 1, '2024-06-04 05:53:00', '2024-06-04 05:53:00', NULL, 'interview-reminder-to-jobseeker'),
(23, 'Job Seeker Changed Joining Date', 'Job Seeker Changed Joining Date', '<p>Hi&nbsp;<strong>{name}</strong>,</p>\r\n\r\n<p>Jobseeker&nbsp;<strong>{jobseeker_name}</strong>&nbsp;has changed his<br />\r\njoining date from&nbsp;<strong>{from_date}</strong>&nbsp;to&nbsp;<strong>{to_date}</strong>&nbsp;for&nbsp;<strong>{job_name}</strong>&nbsp;job&nbsp;application.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thanks<br />\r\nVR Excellance</p>', 0, 0, 1, 1, '2024-06-04 05:54:22', '2024-06-04 05:54:22', NULL, 'job-seeker-changed-joining-date'),
(24, 'dffdfd35', 'fd', '<p>fdf</p>', 0, 1, 1, 1, '2024-06-05 05:39:50', '2024-06-05 05:40:17', '2024-06-05 05:40:17', 'df'),
(25, 'Important Announcement Email', 'Important Announcement Email', '<p>Hi&nbsp;<strong>{name}</strong>,</p>\r\n\r\n<p>{message}</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thanks<br />\r\nVR Excellance</p>', 0, 0, 1, 1, '2024-06-07 11:38:12', '2024-06-07 11:38:12', NULL, 'important-announcement-email'),
(26, 'Jobseeker Maybe Status Reminder', 'Jobseeker Maybe Status Reminder', '<p>Hello&nbsp;<strong>{name}</strong>,</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>You have not respond&nbsp;to&nbsp;<strong>{jobseeker_name}</strong>&nbsp;for&nbsp;<strong>{job_title}</strong>&nbsp;job application.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thanks<br />\r\nVR Excellance</p>', 0, 0, 1, 1, '2024-07-02 09:45:07', '2024-07-02 09:45:07', NULL, 'jobseeker-maybe-status-reminder'),
(27, 'Jobseeker Interview Reschedule Request', 'Jobseeker Interview Reschedule Request', '<p>Hi&nbsp;<strong>{name}</strong>,</p>\r\n\r\n<p>You have interview reschedule request from&nbsp;<strong>{jobseeker_name}</strong>&nbsp;for&nbsp;<strong>{job_title}</strong>&nbsp;job application<br />\r\nrequested reschedule&nbsp;interview date is&nbsp;<strong>{interview_date}</strong>.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thanks<br />\r\nVR Excellance</p>', 0, 0, 1, 1, '2024-07-02 09:45:33', '2024-07-02 09:45:33', NULL, 'jobseeker-interview-reschedule-request'),
(28, 'Employer Reschedule Interview Feedback Mail', 'Employer Reschedule Interview Feedback Mail', '<p>Hi&nbsp;<strong>{name}</strong>,</p>\r\n\r\n<p>Your interview rescheule request is&nbsp;<strong>{status}</strong>&nbsp;by&nbsp;<strong>{employer_name}</strong><br />\r\n<br />\r\n<strong>{reason}</strong></p>\r\n\r\n<p>Thanks<br />\r\nVR Excellance</p>', 0, 0, 1, 1, '2024-07-02 09:46:18', '2024-07-02 09:46:18', NULL, 'employer-reschedule-interview-feedback-mail');
