(1, 'WordPress Developer', 5, NULL, '<p><strong>WordPress Developer Job Summary for 4 Years Experience:</strong></p>\r\n\r\n<p>We are seeking an experienced WordPress Developer with a minimum of 4 years of hands-on experience to join our dynamic team. The ideal candidate should have a strong background in web development, with a focus on creating and maintaining WordPress websites. As a WordPress Developer, you will be responsible for both back-end and front-end development, ensuring seamless integration with third-party plugins and themes.</p>\r\n\r\n<p><strong>Responsibilities:</strong></p>\r\n\r\n<ol>\r\n	<li>\r\n	<p><strong>Website Development:</strong></p>\r\n\r\n	<ul>\r\n		<li>Develop and maintain responsive WordPress websites, ensuring optimal performance, and an excellent user experience.</li>\r\n	</ul>\r\n	</li>\r\n	<li>\r\n	<p><strong>Theme Customization:</strong></p>\r\n\r\n	<ul>\r\n		<li>Customize and implement WordPress themes to align with client specifications and design requirements.</li>\r\n	</ul>\r\n	</li>\r\n	<li>\r\n	<p><strong>Plugin Integration:</strong></p>\r\n\r\n	<ul>\r\n		<li>Integrate and configure third-party plugins to enhance website functionality and meet project objectives.</li>\r\n	</ul>\r\n	</li>\r\n	<li>\r\n	<p><strong>Code Optimization:</strong></p>\r\n\r\n	<ul>\r\n		<li>Write clean, efficient, and well-documented code. Optimize website performance for speed and scalability.</li>\r\n	</ul>\r\n	</li>\r\n	<li>\r\n	<p><strong>Collaboration:</strong></p>\r\n\r\n	<ul>\r\n		<li>Collaborate with designers, project managers, and other stakeholders to deliver high-quality web solutions.</li>\r\n	</ul>\r\n	</li>\r\n	<li>\r\n	<p><strong>Troubleshooting:</strong></p>\r\n\r\n	<ul>\r\n		<li>Identify and resolve technical issues, bugs, and challenges related to WordPress development.</li>\r\n	</ul>\r\n	</li>\r\n	<li>\r\n	<p><strong>Security Implementation:</strong></p>\r\n\r\n	<ul>\r\n		<li>Implement security best practices to safeguard websites from potential vulnerabilities.</li>\r\n	</ul>\r\n	</li>\r\n	<li>\r\n	<p><strong>Stay Updated:</strong></p>\r\n\r\n	<ul>\r\n		<li>Keep abreast of the latest industry trends, technologies, and WordPress updates. Implement best practices accordingly.</li>\r\n	</ul>\r\n	</li>\r\n</ol>', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 1, 6, 6, '2024-01-05 08:35:51', '2024-06-20 05:18:43', '2024-06-20 05:18:43', 1, '0009', 0, NULL, 1, NULL, 'wordpressdeveloper-skg-ahemdabad-5years', '2024-04-05', '<p><strong>Benefits:</strong></p>\r\n\r\n<ul>\r\n	<li>Competitive salary and benefits package.</li>\r\n	<li>Opportunities for professional growth and development.</li>\r\n	<li>Collaborative and innovative work environment.</li>\r\n</ul>\r\n\r\n<p>If you are a skilled WordPress Developer looking for an exciting opportunity to contribute to cutting-edge web projects, we invite you to apply. Join our team and be a key player in crafting exceptional online experiences for our clients.</p>', 1, 0, 1, NULL, NULL, NULL, 8, NULL, NULL, NULL, NULL, NULL, '1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '[\"[\\\"\\\"]\"]', 'reach_out_via_email', 'yes', 'Google', NULL, NULL, NULL, NULL, NULL, '2000', '2000', NULL, NULL, '2000', '2000'),
(2, 'Laravel Developer', 1, NULL, '<p>1. Enterprise.<br />\r\n2. Corporation.<br />\r\n3. Business organization.<br />\r\n4. Firm.<br />\r\n5. Company entity.</p>', NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, 1, 8, 8, '2024-01-08 07:00:29', '2024-07-04 10:25:44', '2024-07-04 10:25:44', 1, '0004', 0, NULL, 1, 'navarangpura', 'softwaredeveloper-testasemployer-ahemdabad-1year', '2024-04-08', '<p>1.&nbsp;organization.<br />\r\n2. Expertise.<br />\r\n3. Competence, corporation.<br />\r\n4. Proficiency, business.<br />\r\n5. Talent, enterprise.</p>', 1, 1, 1, NULL, NULL, NULL, 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Microsoft', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
